window.bookSummaryJSON = "<p><b>Will the creators of Metamorphosis Online and their infighting ruin the game for everyone? </b></p> <p><b>Over Gracie’s dead avatar. </b></p> <p>Others want to learn what is allowing Gracie’s team to jump in the ranks, and they’re willing to go to great and scuzzy lengths to figure it out.&nbsp;</p> <p>The group has decided to form a guild, but can they hold it together long enough to figure out a team tabard?&nbsp;</p> <p>Can Gracie hold her team together while her personal life is going nowhere? Will she accept her mom’s invite to join the family for her sister’s engagement?&nbsp;</p> <p>Metamorphosis Online is changing lives...some for the better, some for the worse.&nbsp;</p> <p>The only thing Gracie believes in is the power of her family...her digital family. She’s learning that the rest of life is just details.</p>"; 
